import React from 'react';
import ListItem from './ListItem';
import styles from './List.module.scss';

const ListWrapper = ({items}) => (
    <ul className={styles.List}>
        {items.map(item => (
            <ListItem key={item.name}{...item}/>
        ))}
    </ul>
)
export default ListWrapper;
